import React, { Component } from 'react';
import Regular from './Regular.js'
import './Regular.css'


class App extends Component {
    state = {
        fontColor: 'black',
        bgColor: 'white',
    }

    setColor = (bg, font) => {
        this.setState({
            fontColor: font,
            bgColor: bg,
        });
        console.log("font: " + this.state.fontColor + " bg: " + this.state.bgColor);
    }

    render() {
        return (
            <Regular></Regular>
        );
    }
}

export default App;
